export default function Detail({name,image,area,population,subregion,TouristActivities,capital,key,continent}){
    return (
        <div>
            <img src={image} alt="img not found" width="200px" height="250px" />
            <h3>{name}</h3>
            <h5>{key}</h5>
            <h5>{continent}</h5>
            <h5>{capital}</h5>
            <h5>{subregion}</h5>
            <h5>{area}</h5>
            <h5>{population}</h5>
            <h5>{TouristActivities}</h5>

        </div>
    )
}
